-{============== dBpoweramp Music Converter R14.1 Reference Edition ==============}-
************************************************************************************

Reference Edition: created for Audio Professionals and Enthusiasts, who demand more:
more technical, more features, more pro-codecs.


Often called a Swiss army knife of Audio, dBpowerAMP Reference Edition is able to:

* Convert audio files utilizing multiple CPUs. mp3, mp4, m4a, 
  Windows Media Audio (WMA), Ogg Vorbis, AAC, Monkeys Audio, FLAC, 
  Apple Lossless (ALAC)
* Rip Securely digitally record audio CDs, with C2 error pointer support,
* Windows Integration popup info tips, audio properties, columns, edit ID-Tags,
* DSP Effects DirectX &amp; VST adaptors, with dBpoweramp's own,
* Command Line Encoding convert using the command line,
* Script dBpoweramp programmatically using a COM object,

